import React, { useState } from 'react'
// import img from "./pics/sk1.jpg"
import Pordcar from './Pordcar'

const Portfolio = () => {
    // const [pCard, setPCard] = useState()
    return (
        <>
        <div className="portfolio">
    {
        Pordcar.map((crnVal)=>{
            return(
                <>
                <a href="/">
                    <div className="port_item">
                        <div className="port_heading">{crnVal.hading}</div>
                        <img src={crnVal.img} alt="" />
                    </div>
                </a>
                </>
            )
        })

    }
            </div>
    <a class="view_link" href="/">
    <p>VIEW ALL WORK</p>
    </a>           
        </>
    )
}

export default Portfolio
